import { SettingsCellRounded } from '@material-ui/icons'
import { useState } from 'react'
import StyledButton from './styledComponents/StyledButton.js'

const Home = () => {
    return (
        <div>
            <h1>Home Page</h1>
            <StyledButton onClick={()=>this.setCount(this.count+1)}>
                Count
            </StyledButton>
            {this.count}
        </div>
    )
}

export default Home
